column36:
”Dumnezeu are o biserică. Nu este o catedrala mare, nici cea stabilita oficial, nici diferitele confesiuni; ci poporul care iubeste pe Dumnezeu și păzește poruncile Lui. "Căci acolo unde sunt doi sau trei adunați în numele Meu, acolo sunt și Eu în mijlocul lor." Matei 18:20. Deși Hristos este chiar printre puținii umili, aceasta este biserica Sa, pentru că numai prezența Celui Preaînalt, care locuiește în veșnicii poate constitui o biserică.”{UL 315.5}ed.engleza.

”Domnul Isus va avea întotdeauna un popor ales să-l slujească. Când poporul evreu au respins pe Hristos, Prințul vieții, El a luat de la ei împărăția lui Dumnezeu și a dat-o neamurilor. Dumnezeu continuă să lucreze în conformitate cu acest principiu în fiecare ramură a activității sale. Când o biserică se dovedește necredincioasă față de lucrarea Domnului, indiferent de cât de mare și sfântă ar putea fi chemarea lor, Dumnezeu nu poate continua să lucreze cu ei. Altii sunt apoi aleși să poarte responsabilități importante. Dar, în cazul în care aceștia, la rândul lor, nu purifica viața lor de fiecare acțiune greșită, dacă nu stabilesc principii curate și sfinte în toate frontierele lor, atunci Domnul îi va umili și, dacă nu se pocăiesc, îi va lua din locul lor și vor fi dezonorați ...”{EG White, UL 131.3, Alza tus ojos,p. 129,3}

”Suntem în primejdia de a deveni o soră a Babilonului decăzut, îngăduind bisericilor noastre să fie stricate, pline de un spirit dezgustător, o colivie pentru tot felul de păsări necurate şi scârboase; oare vom ajunge noi curaţi fără să încercăm în mod hotărât să tratăm răul existent?” {MCS 188.3, MS 21,pag.380, Letter 51, 6 sep.1886}

”Dar slava Domnului s-a depărtat de Israel; deși mulți continuă să observe formele religiei, puterea și prezența Sa lipsesc.” {5M 210.2}

"Am văzut că Tatăl nostru are copii sinceri printre adventiștii cu numele și bisericile căzute, și înainte ca plăgile să fie vărsate, lideri și oameni vor fi chemați afară din aceste biserici și vor primi cu bucurie adevărul. Satana știe aceasta; și înainte ca marea strigare a îngerului al treilea să fie dată, el creează o stare de emoție în aceste organisme religioase, ca cei care au respins adevărul să creadă că Domnul este cu ei. "{EW, p 261}.
Vestea cea mai înfricoșătoare de aici, este profeția că cei care vor respinge apelul ca să iasă din bisericile AZȘ și din bisericile căzute vor experimenta o "emoție”, provenind de la Satan pentru ai înșela să creadă că Domnul este cu ei.
"Mi s-a arătat nevoia de separare a celor care cred că noi avem ultima solie de îndurare, de cei care sunt îmbibaţi zilnic cu noi erori. Am văzut că nici tânăr, nici bătrân nu ar trebui să participe la adunări, pentru că este greşit, atâta timp cât, sunt încurajaţi să învețe o eroare care este o otravă mortală pentru suflet și să învețe ca doctrine poruncile oamenilor. Influența acestor adunări nu este bună. Dacă Domnul ne-a eliberat din astfel de întuneric și de eroare, ar trebui să stăm tari în libertatea în care El ne-a eliberat și să ne bucurăm de adevăr. Domnul este nemulţumit de noi când mergem să ascultăm erori, fără a fi obligați să mergem; cu excepția cazului în care El ne trimite la acele întâlniri unde eroarea este forțată, iniţial, la oameni prin puterea voinței. El nu ne va ține.
Îngerii nu-şi mai îndreaptă grija lor atentă asupra noastră, și suntem lăsați pradă loviturilor vrăjmașului, care urmăreşte să fim orbiţi și slăbiţi de el și de puterea îngerilor lui răi; iar lumina din jurul nostru să devină contaminată de întuneric. "{Scrieri Timpurii, 124,3}

Dumnezeu Îşi pune deoparte un popor şi îi pregăteşte pe ai Săi să stea ca unul singur, uniţi, să vorbească aceleaşi lucruri şi astfel să împlinească rugăciunea lui Hristos pentru ucenicii Săi... Oameni care, potrivit Cuvântului lui Dumnezeu, fac tot ce le stă în putere pentru a fi una, care sunt întemeiaţi în solia celui de-al treilea înger, sunt priviţi cu suspiciune pe motivul că ei îşi extind lucrarea şi adună suflete de partea adevărului. (1M 417.3-4)

”Atenția mi-a fost îndreptată către aceia care pretind că sunt adventiști, dar care resping adevărul prezent și am văzut că grupul lor se fărâmița și că mâna Domnului se afla în mijlocul lor pentru a-i dezbina și împrăștia acum, în vremea secerișului, astfel încât mărgăritarele prețioase, aflate printre ei, care au fost amăgite anterior, să poată avea ochii deschiși pentru a vedea care este starea lor reală. Și acum, când le este prezentat adevărul de către solii Domnului, ei sunt pregătiți să asculte și să-i vadă frumusețea și armonia și să se despartă de rătăcirile și DE CEI CU CARE SE ÎNTOVĂRĂȘISERĂ ÎNAINTE, să îmbrățișeze adevărul prețios și să stea acolo unde își pot defini poziția.” {ST 69.2}

”A avut loc o ieşire, o categorică despărţire de cei nelegiuiţi, o fugă pentru a scăpa cu viaţă. Aşa a fost în zilele lui Noe; aşa s-au petrecut lucrurile cu Lot; aşa a fost cu ucenicii înainte de distrugerea Ierusalimului şi aşa va fi în zilele din urmă. (truncated)
